import React, { Component } from "react";
import NodeImage from "../Images/logo.svg";
class About extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div>
          <div
            type="button"
            class="list-group-item list-group-item-action active"
          >
            Technology
          </div>
          <div className="list-group-item list-group-item-action">
            <img src={NodeImage} height="100px" width="100px" />
            <h2 style={{ display: "inline" }}>Node.js</h2>
          </div>
          <div className="list-group-item list-group-item-action">
            <img src={NodeImage} height="100px" width="100px" />
            <h2 style={{ display: "inline" }}>Node.js</h2>
          </div>
          <div className="list-group-item list-group-item-action">
            <img src={NodeImage} height="100px" width="100px" />
            <h2 style={{ display: "inline" }}>Node.js</h2>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default About;
